import { Route, Routes } from "react-router-dom";
import HomePage from './Pages/HomePage';
import CartPage from './Pages/CartPage';

const App = () => {
  return (
    <div>
      <nav>

      </nav>

      <Routes>
        <Route path="/" element={ <HomePage/> } ></Route>      
        <Route path="/" element={ <CartPage/> } ></Route>      
      </Routes>

  </div>
  );
};

export default App;
